import React, { useState } from 'react';
import "./VeterinarianRecord.css"

function VeterinarianRecord() {
  // Define state variables to store input values
  const [weight, setWeight] = useState('');
  const [height, setHeight] = useState('');
  const [medications, setMedications] = useState('');
  const [treatments, setTreatments] = useState('');

  // Function to handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();

    // Here you can perform any backend logic (e.g., send data to a server)
    // For now, we'll just log the values to the console
    console.log('Weight:', weight);
    console.log('Height:', height);
    console.log('Medications:', medications);
    console.log('Treatments:', treatments);

    // Clear the form fields after submission
    setWeight('');
    setHeight('');
    setMedications('');
    setTreatments('');
  };

  return (
    <div className="veterinarian-records-container">
      <h2>Veterinarian Records</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="weight">Weight:</label>
          <input
            type="text"
            id="weight"
            value={weight}
            onChange={(e) => setWeight(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="height">Height:</label>
          <input
            type="text"
            id="height"
            value={height}
            onChange={(e) => setHeight(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="medications">Medications:</label>
          <input
            type="text"
            id="medications"
            value={medications}
            onChange={(e) => setMedications(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="treatments">Treatments:</label>
          <input
            type="text"
            id="treatments"
            value={treatments}
            onChange={(e) => setTreatments(e.target.value)}
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default VeterinarianRecord;
